  /**
   * Reservar una entrada de material
   * Reservar el bulto
   * Reservar el MAC
   * Si no ha sido posible reservar el mac, devuelve <code>false</code>
   * @param idTraslo
   */
  public boolean reservarEntrada(int idTraslo)
  {
    Number canAReservar;
    if (getCandis().compareTo(getCanpen()) > 0)
      canAReservar = new Number(getCanpen());
    else
      canAReservar = new Number(getCandis());
    SgamacViewRowImpl macRow = (SgamacViewRowImpl)getSgamacView();
    if (macRow.reservarEntradaMaterial(getUbides(), getIdart(), canAReservar, idTraslo))
    {
      SgalbultoViewRowImpl lbultoRow = (SgalbultoViewRowImpl)getSgalbultoView();
      lbultoRow.reservarEntrada(getIdmac(), canAReservar);
      return true;
    }
    return false;
  }
  
  public String toString()
  {
    return "Entrada puesto: " + getIdpuesto() + " Doc: " + getIddoc() + " línea: " + getIdlin() + " bulto: " + getIdbulto() + " Art: " + getIdartif() + " Can.Disp: " + getCandis() + " Can. Pend: " + getCanpen() + " Matrícula: " + getIdmac();
  }

